        private ConnectRequest GetConnectSettings()
        {
            return new ConnectRequest
            {
                SettingsJson = "{\"OAuthClientID\":\"123\",\"OAuthClientSecret\":\"456\",\"Username\":\"test\",\"Password\": \"test\"}"
            };
