        [Fact]
        public async Task ConnectTest()
        {
            // setup
            var mockHttp = new MockHttpMessageHandler();

            mockHttp.When(
                    "https://login.naveego.com/oauth2/token")
                .Respond("application/json",
                    @"{
                ""id"": """",
                ""access_token"": ""AUTH123"",
                ""expires_in"": 900,
                ""refresh_token"": ""REFRESH123"",
                ""issued_at"": 1561997369
            }");
            
            
            mockHttp.When("https://useast-pod-01.naveegoapi.com/v3/whoami")
                .Respond("application/json",
                    "{\"id\":\"admin\",\"name\":\"admin\",\"firstName\":\"admin\",\"lastName\":\"admin\",\"email\":\"pouyan.poorlakani@sbti.com\",\"emailVerified\":true,\"emailVerificationToken\":null,\"serviceTicket\":\"LhrJXi_fwcwoyYHPQK0ybFmSxFMh6mVNELtfik950\",\"isDisabled\":false,\"forcePasswordReset\":false,\"forceAcceptAgreement\":false,\"lastLogin\":\"2019-06-27T20:53:54.164Z\",\"businessPhone\":null,\"edition\":null,\"mobilePhone\":null,\"userId\":\"03d75be8-44f7-4583-b592-d08ea7b4d3d6\",\"authId\":\"qxeDkvLfwjsPQtMoViTqLYHUOF3cw\",\"manager\":null,\"department\":null,\"live\":{\"status\":\"disconnected\",\"statusDate\":\"2017-05-25T19:00:50.595Z\",\"connectionIds\":null},\"notificationCount\":1158,\"displayName\":\"admin admin\",\"roles\":[\"admin\",\"mdm.admin\",\"dataquality.ruleadmin\"],\"modules\":[\"mdm\",\"dataquality\",\"workflow\",\"queues\"]}");


            Server server = new Server
            {
                Services = {Publisher.BindService(new Plugin_Naveego_Legacy.Plugin.Plugin(mockHttp.ToHttpClient()))},
                Ports = {new ServerPort("localhost", 0, ServerCredentials.Insecure)}
            };
            server.Start();

            var port = server.Ports.First().BoundPort;

            var channel = new Channel($"localhost:{port}", ChannelCredentials.Insecure);
            var client = new Publisher.PublisherClient(channel);

            var request = GetConnectSettings();

            // act
            var response = client.Connect(request);

            // assert
            Assert.IsType<ConnectResponse>(response);
            Assert.True(response.OauthError.IsNullOrEmpty(), "OAuthError not null or empty");
            Assert.True(response.ConnectionError.IsNullOrEmpty(), $"ConnectionError not null or empty:{response.ConnectionError}");
            Assert.True(response.SettingsError.IsNullOrEmpty(), $"SettingsError not null or empty:{response.SettingsError}");

            // cleanup
            await channel.ShutdownAsync();
            await server.ShutdownAsync();
        }
        
